    end,
    if F8 == undefined -> ok;
       true -> v_type_bytes(F8, [op | Path])
    end,
    if is_list(F9) ->
	   _ = [v_type_bytes(Elem, [fl | Path]) || Elem <- F9], ok;
       true ->
	   mk_type_error({invalid_list_of, bytes}, F9, Path)
    end,
    if F10 == undefined -> ok;
       true -> v_type_bytes(F10, [presort | Path])
    end,
    ok.

